    <div className='movie-card'>
    {movie.poster_path ? <img className={"movie-cover"} src={`${IMAGE_PATH}${movie.poster_path}`} alt="" /> : null}
    <h5 className={"movie-title"}>{movie.title}</h5>
</div>
  )
}

export default MovieDetail
